webpackJsonp([0x92fb6cad3192],{1083:function(t,e){t.exports={data:{wordpressPost:{title:"Three things you need to know by Robyn Lawley",content:'<p><strong>Robyn Lawley</strong>, model, <a href="http://robynlawley.com.au/">swimsuit designer</a> and <a href="http://www.pantene.com.au/en-au">Pantene</a> ambassador knows what she likes. And she&#8217;s happy to share with you. We know this woman by the way and can we just say this &#8211; she&#8217;s even more <strong>INCREDIBLE</strong> in the flesh than you can possibly imagine. Yep. True that.</p>\n<p>Anyway, back to her <strong>Top Three</strong>. Take it away Robyn.</p>\n<p><strong>Styling Tip</strong></p>\n<p>&#8220;If I&#8217;ve only got five minutes to get out the door, but want to look good I brush my hair, spray some sea salt spray in and then top knot it tightly into four separate buns. After five minutes, I take my hair out and I have beautiful, tousled locks.&#8221;</p>\n<img class="alignnone size-medium wp-image-1502" src="http://dcqiwphk5imn5.cloudfront.net/wp-content/uploads/2017/04/08225944/Robyn-beach-jpg-300x105.jpg" alt="" width="300" height="105" srcset="http://dcqiwphk5imn5.cloudfront.net/wp-content/uploads/2017/04/08225944/Robyn-beach-jpg-300x105.jpg 300w, http://dcqiwphk5imn5.cloudfront.net/wp-content/uploads/2017/04/08225944/Robyn-beach-jpg-768x268.jpg 768w, http://dcqiwphk5imn5.cloudfront.net/wp-content/uploads/2017/04/08225944/Robyn-beach-jpg.jpg 907w" sizes="(max-width: 300px) 100vw, 300px" />\n<p><em>Yet another incredible shot of this amazing woman &#8211; model, mother, wife, friend. Image: Instagram/@robynlawley</em></p>\n<p><strong>A Little Soul </strong></p>\n<p>&#8220;My mother always told me that a beautiful woman is one who follows her own moral compass and does good things in the world.&#8221;</p>\n<img class="alignnone size-medium wp-image-1503" src="http://dcqiwphk5imn5.cloudfront.net/wp-content/uploads/2017/04/08230054/black-and-white-jpg-300x218.jpg" alt="" width="300" height="218" srcset="http://dcqiwphk5imn5.cloudfront.net/wp-content/uploads/2017/04/08230054/black-and-white-jpg-300x218.jpg 300w, http://dcqiwphk5imn5.cloudfront.net/wp-content/uploads/2017/04/08230054/black-and-white-jpg-768x559.jpg 768w, http://dcqiwphk5imn5.cloudfront.net/wp-content/uploads/2017/04/08230054/black-and-white-jpg.jpg 806w" sizes="(max-width: 300px) 100vw, 300px" />\n<p><em>And yes &#8211; she actually looks this good in the flesh, better even. Amazing. Oh and she&#8217;s smart and sweet too. Image: Instagram/@robynlawley</em></p>\n<p><strong>Products to Love</strong></p>\n<p>&#8220;My favourite three beauty products right now? <a href="https://www.priceline.com.au/pantene-3-minute-miracle-single-15-ml">Pantene Pro V 3 Minute Miracle Protection Conditioner</a>, <a href="https://www.sephora.com.au/products/benefit-cosmetics-high-beam-face-highlighter-mini">Benefit High Beam Face Highlighter</a>, and <a href="https://www.sephora.com.au/products/anastasia-beverly-hills-brow-definer/v/medium-brown">Anastasia Beverly Hills Brow Definer</a>.</p>\n<img class="alignnone size-medium wp-image-1505" src="http://dcqiwphk5imn5.cloudfront.net/wp-content/uploads/2017/04/08231301/Anastasia-jpg-300x300.jpg" alt="" width="300" height="300" srcset="http://dcqiwphk5imn5.cloudfront.net/wp-content/uploads/2017/04/08231301/Anastasia-jpg-300x300.jpg 300w, http://dcqiwphk5imn5.cloudfront.net/wp-content/uploads/2017/04/08231301/Anastasia-jpg-150x150.jpg 150w, http://dcqiwphk5imn5.cloudfront.net/wp-content/uploads/2017/04/08231301/Anastasia-jpg-768x768.jpg 768w, http://dcqiwphk5imn5.cloudfront.net/wp-content/uploads/2017/04/08231301/Anastasia-jpg.jpg 900w" sizes="(max-width: 300px) 100vw, 300px" /><img class="alignnone size-medium wp-image-1506" src="http://dcqiwphk5imn5.cloudfront.net/wp-content/uploads/2017/04/08231412/Pantene-300x300.jpg" alt="" width="300" height="300" srcset="http://dcqiwphk5imn5.cloudfront.net/wp-content/uploads/2017/04/08231412/Pantene-300x300.jpg 300w, http://dcqiwphk5imn5.cloudfront.net/wp-content/uploads/2017/04/08231412/Pantene-150x150.jpg 150w, http://dcqiwphk5imn5.cloudfront.net/wp-content/uploads/2017/04/08231412/Pantene.jpg 675w" sizes="(max-width: 300px) 100vw, 300px" /><img class="alignnone size-medium wp-image-1508" src="http://dcqiwphk5imn5.cloudfront.net/wp-content/uploads/2017/04/08231520/Benefit-high-beam-300x300.jpg" alt="" width="300" height="300" srcset="http://dcqiwphk5imn5.cloudfront.net/wp-content/uploads/2017/04/08231520/Benefit-high-beam-300x300.jpg 300w, http://dcqiwphk5imn5.cloudfront.net/wp-content/uploads/2017/04/08231520/Benefit-high-beam-150x150.jpg 150w, http://dcqiwphk5imn5.cloudfront.net/wp-content/uploads/2017/04/08231520/Benefit-high-beam-768x768.jpg 768w, http://dcqiwphk5imn5.cloudfront.net/wp-content/uploads/2017/04/08231520/Benefit-high-beam.jpg 900w" sizes="(max-width: 300px) 100vw, 300px" />\n<p><em>Anastasia Beverly Hills Brow Definer, Pantene Pro V 3 Minute Miracle Protection Conditioner and Benefit High Beam Face Highlighter. Three quality buys that help Robyn to look like this. Yep.</em></p>\n<p>&nbsp;</p>\n',better_featured_image:{source_url:"http://dcqiwphk5imn5.cloudfront.net/wp-content/uploads/2017/04/08225644/Robyn-Lawley-nude-jpg.jpg"},categories:[{slug:"hair",name:"Hair"}]},site:{siteMetadata:{title:"The Beauty Insider"}}},pathContext:{id:"76e66a18-9d4c-5951-b7d8-ea1646d84a10"}}}});
